import React from 'react';
import axios from 'axios';

const api = axios.create({baseURL:'http://localhost:8080/'})

function GetAccountByID () {

    api.get('accounts/1').then(res => {
            console.log(res.data);
        }
    )

}

export default GetAccountByID;
